Este soneto fue escrito por Rubén Darío (1867-1916), poeta nicaragüense considerado el máximo representante del modernismo literario en lengua española. Aunque vivió entre los siglos XIX y XX, se le considera principalmente un poeta del siglo XIX, ya que fue durante este período cuando desarrolló la mayor parte de su obra y alcanzó su madurez literaria.
